/**
 * Override the printHeaderRow of the jsPDF.API Function
 */
if (window.jsPDF.API) {
	window.jsPDF.API.printHeaderRow = function (lineNumber, new_page) {
		if (!this.tableHeaderRow) {
			throw 'Property tableHeaderRow does not exist.';
		}
		var tableHeaderCell, tmpArray, i, ln;
		this.printingHeaderRow = true;

		if (window.jsPDF.API.headerFunction !== undefined) {
			var position = headerFunction(this, pages);
			setLastCellPosition(position[0], position[1], position[2], position[3], -1);
		}

		this.setFontStyle('bold');
		var tempHeaderConf = [];

		for (i = 0, ln = this.tableHeaderRow.length; i < ln; i += 1) {
			this.setFillColor(200, 200, 200);
			tableHeaderCell = this.tableHeaderRow[i];

			if (new_page) {
				//Adding top margin -50 to resolved the issue of the overlapping table header and first row on 2nd page of pdf.
				this.margins.top = -50;
				tableHeaderCell[1] = this.margins && this.margins.top || 0;
				tempHeaderConf.push(tableHeaderCell);
			}

			tmpArray = [].concat(tableHeaderCell);
			this.cell.apply(this, tmpArray.concat(lineNumber));
		}

		if (tempHeaderConf.length > 0) {
			this.setTableHeaderRow(tempHeaderConf);
		}

		this.setFontStyle('normal');
		this.printingHeaderRow = false;
	};
}

